import React from "react";
import "./style.css";

function Header(props) {
  return (
    <header>
      <p>Clicky Game</p>
      <p>{props.response}</p>
      <p>Score: {props.score} | Top Score {props.topScore}</p> 
      <button className="btn btn-primary" onClick={this.handleDouble}>
            Double
          </button>   
    </header>

  );
}

export default Header;
